import React from 'react'

const Navbar = () => {
    return (
        <nav className="navbar navbar-dark bg-grey mb6">
        <p><span className="navbar-brand">REACT LYRICS FINDER: Search Artist Tracks and Discover Song Lyrics!</span></p>
        </nav>
    )
}
export default Navbar;
